long_desc.thetext:
Forked from bug 212644

The platform dialog that appears when a job returns an error status makes a poor choice for the problem description and reason text.  The description text is simply the job name, and the reason text is either the exception message, or the string "Check the details" in the case where the status has no exception.  The job name is typically not suitable as the problem description.  I.e., if you have a job whose name is "Building", then you see a dialog like this:

Title: Problem Occurred
Description: Building
Reason: Check the details

With the current algorithm, it isn't possible for a client to construct an error status that will show a user friendly exception dialog that properly indicates the description and reason for the problem. Further, this is a regression from the behaviour before status handling API was introduced. I will attach screen shots that illustrate old and new behaviour for the following job failures.

Example 1:

  class SampleJob extends Job {
    SampleJob() {
      super("This is the job name");
    }
    protected IStatus run(IProgressMonitor monitor) {
      MultiStatus result = new MultiStatus("aa", 1, "This is the parent problem message", null);
      result.add(new Status(IStatus.ERROR, "aa", 1, "This is the child problem message", null));
      return result;
    }
  }

Example 2:

  class SampleJob extends Job {
    SampleJob() {
      super("This is the job name");
    }
    protected IStatus run(IProgressMonitor monitor) {
      return new Status(IStatus.ERROR, "aa", 1, "This is the problem message", new Exception("This is the exception text"));
    }
  }
